import logo from "./logo.svg";
import "./App.css";
import { useState } from "react";

function App() {
  let post = "Jordan 3";
  let [titles, setTitles] = useState([
    "ÎÇ®ÏûêÏΩîÌä∏ Ï∂îÏ≤ú",
    "Í∞ïÎÇ® Ïö∞ÎèôÎßõÏßë",
    "ÌååÏù¥Ïç¨ ÎèÖÌïô",
  ]);
  let [like1, setLike1] = useState(0);
  let [like2, setLike2] = useState(0);
  let [like3, setLike3] = useState(0);

  let [modal, setModal] = useState("close");

  return (
    <div className="App">
      <div className="black-nav">
        <h4>GirlsDo</h4>
      </div>
      <button
        onClick={() => {
          let copy = [...titles];
          copy = copy.sort();
          setTitles(copy);
        }}
      >
        Alphabetical Order
      </button>
      <div className="list">
        <h4>
          {titles[0]}
          <span
            onClick={() => {
              setLike1(like1 + 1);
            }}
          >
            üëç
          </span>{" "}
          {like1}
        </h4>
        <p>2nd February Published</p>
        <button
          onClick={() => {
            let copy = [...titles];
            copy[0] = "Ïó¨ÏûêÏΩîÌä∏ Ï∂îÏ≤ú";
            setTitles(copy);
          }}
        >
          Press
        </button>
      </div>
      <div className="list">
        <h4>
          {titles[1]}{" "}
          <span
            onClick={() => {
              setLike2(like2 + 1);
            }}
          >
            üëç
          </span>{" "}
          {like2}
        </h4>
        <p>2nd February Published</p>
      </div>
      <div className="list">
        <h4>
          {titles[2]}{" "}
          <span
            onClick={() => {
              setLike3(like3 + 1);
            }}
          >
            üëç
          </span>{" "}
          {like3}
        </h4>
        <p>2nd February Published</p>
      </div>

      <Modal></Modal>
    </div>
  );
}

function Modal() {
  return (
    <div className="modal">
      <h4>Title</h4>
      <p>Date</p>
      <p>Details</p>
    </div>
  );
}

export default App;
